import Link from 'next/link';

const SideNav = () => {

  const styles = {
    display: 'flex',
    flexFlow: 'column',
    backgroundColor: 'black',
    padding: '2rem',
    width: '20%',
    height: '88vh',
    color: 'white',
  }

  const listStyles = {
    display: 'flex',
    flexFlow: 'column',
    padding: '2rem',
    color: 'white',
    
  }

  return (
    <div style={styles}>
      <h1>THE SHADZ LOGO</h1>
      <ul style={listStyles}>
        <Link href='/shop'>
          <a>SHOP</a>
        </Link>
        <Link href='/shopInsta'>
          <a>SHOP INSTA</a>
        </Link>
        <Link href='/contact'>
          <a>CONTACT US</a>
        </Link>
        <Link href='/'>
          <a>HOME</a>
        </Link>
      </ul>
    </div>
  );
};

export default SideNav;
